import React from 'react';
import './ServicesPage.css';

function ServicesPage() {
  return (
    <div className="services">
      <div className="container">
        <h1>Our Services</h1>
        <p>Details about services...</p>
      </div>
    </div>
  );
}

export default ServicesPage;
